import { TarotCardContent } from "@/utils/types"
import Image from "next/image"

const iconArray = ["①", "②", "③", "④", "⑤"]

export default function TarotCard({
  svg,
  altText,
  yearsOfExperience,
  githubLinks,
  quote,
}: TarotCardContent) {
  return (
    <div style={{ position: "relative" }}>
      <div
        style={{
          top: "64px",
          position: "absolute",
          left: 0,
          right: 0,
          marginLeft: "auto",
          marginRight: "auto",
          scrollSnapAlign: "center",
          width: svg.width,
        }}
      >
        <Image src={svg} alt={altText} />
      </div>
      <div
        style={{
          position: "absolute",
          top: "190px",
          left: 0,
          right: 0,
          marginLeft: "auto",
          marginRight: "auto",
          width: "180px",
        }}
      >
        <p style={{ lineHeight: "10px" }}>
          Years experience: {yearsOfExperience}
        </p>
        <p style={{ lineHeight: "10px" }}>
          Github links:
          {githubLinks?.map((link, i) => (
            <a
              href={link}
              key={`github-link-${i}`}
              target="_blank"
              style={{
                color: "black",
                textDecoration: "none",
                padding: "0 4px",
              }}
            >
              {iconArray[i]}
            </a>
          ))}
        </p>
        <i style={{ lineHeight: "10px", fontSize: "14px" }}>{quote}</i>
      </div>
      <div style={{ display: "flex", justifyContent: "center" }}>
        <TarotCardSvg />
      </div>
    </div>
  )
}

